.box-model {
  position: relative;
}

.logo-box {
  width: 100%;
  padding-top: 26px;
  padding-bottom: 29px;
  border-bottom: 1px solid #282A52;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}

.logo-box .pro-name {
  margin-top: 8px;
  font-size: 14px;
  color: #FFFFFF;
}

.login-bottom-box {
  width: 100%;
  height: 25px;
  display: flex;
  align-items: center;
  justify-content: center;
  position: absolute;
  bottom: 0;
  left: 0;
  margin-bottom: 17px;
}
